function Contact(){ 
return (
<main>
    <h2>Contact Me</h2>
    <form className="form-group" id="contact-form">
      <ul>
        <li>Email: daviddeitz97@gmail.com</li>
        <li>Phone: 740-652-5791</li>
        <li>Github: https://github.com/IonicCraze</li>
      </ul>
        <button className="contact-btn" type="submit">
            Submit
        </button>
    </form>
</main>
);

}



export default Contact;
